import React from 'react'

const TodoList = () => {
    return (
        <>
            <div className=" number-wrap">
                <div className="card-header">Header</div>
                <div className="card-body">Content</div>
                <div className="card-footer">Footer</div>
            </div>
        </>
    )
}

export default TodoList
